// SPDX-License-Identifier: MIT
pragma solidity >= 0.4.22 <0.9.0;

// Using Clinic, Doctor and Patient Contracts here
import "./Clinic.sol";
import "./Doctor.sol";
import "./Patient.sol";

contract QueryManager {
    address clinicContractAddress;
    address doctorContractAddress;
    address patientContractAddress;

    constructor(
      address ClinicContractAddress,
      address DoctorContractAddress,
      address PatientContractAddress
    ){
        clinicContractAddress = ClinicContractAddress;
        doctorContractAddress = DoctorContractAddress;
        patientContractAddress = PatientContractAddress;
    }

    struct doctorNaturalJoinPatientResult {
        string doctorName;
        address doctorID;
        string patientName;
        address patientID;
        string clinicName;
        string department;
    }

    // struct ClinicDetails {
    //     address id;
    //     string name;
    //     string location;
    //     string password;
    // }

    struct DoctorDetails {
        address id;
        string name;
        string clinicName;
        string department;
        string password;
    }

    struct Record { 
        string cid;
        address patientId;
        address doctorId;
        string patientName;
        string doctorName;
        string symptoms;
        string diagnostic;
        string department;
        uint256 timeAdded;
    }

    struct PatientDetails {
        address id;
        string name;
        string department;
        string password;
    }

    // struct PatientRecords {
    //     address id;
    //     Record[] records;
    // }    

    // The structure helps us in performing groupBy Clause
    struct groupBy {
        uint count;
        string doctorName;
    }
    mapping(string => uint) countHelper; 
    //////////////////////////////////////////////////////

    function doctorNaturalJoinPatient() public view returns(doctorNaturalJoinPatientResult [] memory) {
        Doctor doctorContract = Doctor(doctorContractAddress);
        Patient patientContract = Patient(patientContractAddress);

        // Fetching all the registered doctors in the system
        Doctor.DoctorDetails[] memory doctors = doctorContract.getRegisteredDoctors();
        QueryManager.DoctorDetails[] memory registeredDoctors = new QueryManager.DoctorDetails[](doctors.length);

        for (uint256 i = 0; i < doctors.length; i++) {
            registeredDoctors[i] = QueryManager.DoctorDetails(doctors[i].id, doctors[i].name, doctors[i].clinicName, doctors[i].department, doctors[i].password);
        }

        // Fetching all the registered patients in the system
        Patient.PatientDetails[] memory patients = patientContract.getRegisteredPatients();
        QueryManager.PatientDetails[] memory registeredPatients = new QueryManager.PatientDetails[](patients.length);

        for (uint256 i = 0; i < patients.length; i++) {
            registeredPatients[i] = QueryManager.PatientDetails(patients[i].id, patients[i].name, patients[i].department, patients[i].password);
        }

        doctorNaturalJoinPatientResult[] memory result = naturalJoin(registeredDoctors, registeredPatients);     
        return result;
    }

    function naturalJoin(DoctorDetails[] memory left, PatientDetails[] memory right) public pure returns (doctorNaturalJoinPatientResult[] memory) {
        uint leftLen = left.length;
        uint rightLen = right.length;
        uint resultLen = 0;
        doctorNaturalJoinPatientResult[] memory result = new doctorNaturalJoinPatientResult[](leftLen + rightLen);

        for (uint i = 0; i < leftLen; i++) {
            for (uint j = 0; j < rightLen; j++) {
                if (keccak256(abi.encodePacked(left[i].department)) == keccak256(abi.encodePacked(right[j].department))) {
                    result[resultLen].doctorID = left[i].id;
                    result[resultLen].doctorName = left[i].name;
                    result[resultLen].clinicName = left[i].clinicName;
                    result[resultLen].patientID = right[j].id;
                    result[resultLen].patientName = right[j].name;
                    result[resultLen].department = right[j].department;
                    resultLen++;
                }
            }
        }

        assembly {
            mstore(result, resultLen)
        }
        return result;
    }

    function retrieveAllDiagnosisofPatientFromSpecificDate(address patientID, uint256 date) public view returns(Record[] memory) {
        Patient patientContract = Patient(patientContractAddress);
        Patient.Record[] memory records = patientContract.getRecords(patientID);
        QueryManager.Record[] memory recordsFromSpecificDate = new QueryManager.Record[](records.length);
        uint256 counter = 0;
        for (uint256 i = 0; i < records.length; i++) {
            if(records[i].timeAdded >= date) {
                recordsFromSpecificDate[i] = QueryManager.Record(records[i].cid, records[i].patientId, records[i].doctorId, 
                                                             records[i].patientName, records[i].doctorName, records[i].symptoms,
                                                             records[i].diagnostic, records[i].department, records[i].timeAdded);
                counter++;
            }
        }
        assembly {
            mstore(recordsFromSpecificDate, counter)
        }
        return recordsFromSpecificDate;
    }

    function groupByClause(address patientID) public view returns(groupBy[] memory) {
        Patient patientContract = Patient(patientContractAddress);
        Patient.Record[] memory records = patientContract.getRecords(patientID);
        QueryManager.groupBy[] memory recordsFromGroupByClause = new QueryManager.groupBy[](records.length);
        uint256 counter = 0;

        for (uint256 i = 0; i < records.length; i++) {
            uint dummyCount = 0;
            if(records[i].patientId == patientID) {
                if(countHelper[records[i].doctorName] == 0) {
                    dummyCount += 1;
                } else {
                    dummyCount = dummyCount + countHelper[records[i].doctorName] + 1; 
                }
            }
            recordsFromGroupByClause[i] = QueryManager.groupBy(dummyCount, records[i].doctorName);
            counter++;
        }
        assembly {
            mstore(recordsFromGroupByClause, counter)
        }
        return recordsFromGroupByClause;
    } 
}
